import{o as e,c as a,a as s}from"./app.88357bea.js";const n='{"title":"Ressource : Mis àjour d\'un Compte Bancaire","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. Description de la Resource","slug":"_1-description-de-la-resource"},{"level":2,"title":"2. URL et Méthode d\'accès","slug":"_2-url-et-methode-d-acces"},{"level":2,"title":"3. Paramètres","slug":"_3-parametres"},{"level":2,"title":"4. Requête réussie","slug":"_4-requete-reussie"},{"level":2,"title":"5. Cas d\'échec d\'une requête","slug":"_5-cas-d-echec-d-une-requete"}],"relativePath":"guide/services/bankaccount/update.md","lastUpdated":1626369463025}',t={},o=s('<h1 id="ressource-mis-ajour-d-un-compte-bancaire"><a class="header-anchor" href="#ressource-mis-ajour-d-un-compte-bancaire" aria-hidden="true">#</a> Ressource : Mis àjour d&#39;un Compte Bancaire</h1><hr><h2 id="_1-description-de-la-resource"><a class="header-anchor" href="#_1-description-de-la-resource" aria-hidden="true">#</a> 1. Description de la Resource</h2><p>Cette ressource permet de mettre à jour un compte bancaire existant pour un utilisateur donné.</p><h2 id="_2-url-et-methode-d-acces"><a class="header-anchor" href="#_2-url-et-methode-d-acces" aria-hidden="true">#</a> 2. URL et Méthode d&#39;accès</h2><p>Pour mettre à jour un compte bancaire pour un utilisateur quelconque, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /bank_account/id\nid= l&#39;identifiant du compte bancaire.\n</code></pre></div><div class="danger custom-block"><p class="custom-block-title">Rappel</p><p>L&#39;accès aux données à cette ressource se fait via la méthode <strong><code>PATCH</code></strong></p></div><h2 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h2><p>Les paramètres de cette ressouce sont les mêmes que celle de l&#39;ajout d&#39;un compte bancaire qui sont définis dans la section suivante : <a href="/guide/services/bankaccount/store.html#_3-parametres">Paramètres</a></p><h2 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h2><p>Lorsque la requête est validée avec succès, il s&#39;affichera un resultat de type suivant:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;id&quot;</span><span class="token operator">:</span> <span class="token number">61</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Banque almaghreb&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;status&quot;</span><span class="token operator">:</span> <span class="token string">&quot;enabled&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;created_at&quot;</span><span class="token operator">:</span> <span class="token string">&quot;2021-07-12 14:53:22&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;code&quot;</span><span class="token operator">:</span> <span class="token string">&quot;111&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;address&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Boulevard Abdelkrim el khattabi, rabat agdal&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;iban&quot;</span><span class="token operator">:</span> <span class="token null keyword">null</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;bic&quot;</span><span class="token operator">:</span> <span class="token null keyword">null</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;user_id&quot;</span><span class="token operator">:</span> <span class="token number">1</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_5-cas-d-echec-d-une-requete"><a class="header-anchor" href="#_5-cas-d-echec-d-une-requete" aria-hidden="true">#</a> 5. Cas d&#39;échec d&#39;une requête</h2><p>En cas d&#39;échec, Quand vous fournissez un id qui n&#39;existe pas dans la base de donnée, vous aurez un message de type:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;id&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Ce compte bancaire n&#39;exist pas.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',16);t.render=function(s,n,t,r,p,u){return e(),a("div",null,[o])};export default t;export{n as __pageData};
